CKEDITOR.plugins.setLang("a11yhelp","ro",{title:"Instruc\u021biuni de accesibilitate",contents:"Cuprins. Pentru a \xeenchide acest dialog, ap\u0103sa\u021bi tasta ESC.",legend:[{name:"General",items:[{name:"Editeaz\u0103 bara instrumente.",legend:"Apas\u0103 ${toolbarFocus} pentru a naviga prin bara de instrumente. Pentru a te mi\u0219ca prin grupurile de instrumente folose\u0219te tastele TAB \u0219i SHIFT+TAB. Pentru a te mi\u0219ca intre diverse instrumente folose\u0219te tastele S\u0102GEAT\u0102 DREAPTA sau S\u0102GEAT\u0102 ST\xc2NGA. Apas\u0103 butonul SPA\u021aIU sau ENTER pentru activarea instrumentului."},{name:"Dialog editor",legend:"Inside a dialog, press TAB to navigate to the next dialog element, press SHIFT+TAB to move to the previous dialog element, press ENTER to submit the dialog, press ESC to cancel the dialog. When a dialog has multiple tabs, the tab list can be reached either with ALT+F10 or with TAB as part of the dialog tabbing order. With tab list focused, move to the next and previous tab with RIGHT and LEFT ARROW, respectively."},{name:"Editor meniu contextual",legend:"Apas\u0103 ${contextMenu} sau TASTA MENIU pentru a deschide meniul contextual. Treci la urm\u0103toarea op\u021biune din meniu cu TAB sau S\u0102GEAT\u0102 JOS. Treci la op\u021biunea anterioar\u0103 cu  SHIFT+TAB sau S\u0102GEAT\u0102 SUS. Apas\u0103 SPA\u021aIU sau ENTER pentru a selecta op\u021biunea din meniu. Deschide sub-meniul op\u021biunii curente cu SPA\u021aIU sau ENTER sau S\u0102GEAT\u0102 DREAPTA. Revino la elementul din meniul p\u0103rinte cu ESC sau S\u0102GEAT\u0102 ST\xc2NGA. \xcenchide meniul de context cu ESC."},{name:"Editor Caset\u0103 List\u0103",legend:"\xcen interiorul unei liste, treci la urm\u0103torull element cu TAB sau S\u0102GEAT\u0102 JOS. Treci la elementul anterior din list\u0103 cu SHIFT+TAB sau S\u0102GEAT\u0102 SUS. Apas\u0103 SPA\u021aIU sau ENTER pentru a selecta op\u021biunea din list\u0103. Apas\u0103 ESC pentru a \xeenchide lista."},{name:"Editor Element Path Bar",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"Comenzi",items:[{name:" Undo command",legend:"Apas\u0103 ${undo}"},{name:"Comanda precedent\u0103",legend:"Apas\u0103 ${redo}"},{name:"Comanda \xcengro\u0219at",legend:"Apas\u0103 ${bold}"},{name:"Comanda Inclinat",legend:"Apas\u0103 ${italic}"},{name:"Comanda Subliniere",legend:"Apas\u0103 ${underline}"},{name:"Comanda Legatur\u0103",legend:"Apas\u0103 ${link}"},{name:" Toolbar Collapse command",legend:"Press ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Accessibility Help",legend:"Press ${a11yHelp}"},{name:" Paste as plain text",legend:"Press ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tab",pause:"Pause",capslock:"Caps Lock",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",leftArrow:"Left Arrow",upArrow:"Up Arrow",rightArrow:"Right Arrow",downArrow:"Down Arrow",insert:"Insert",leftWindowKey:"Left Windows key",rightWindowKey:"Right Windows key",selectKey:"Select key",numpad0:"Numpad 0",numpad1:"Numpad 1",numpad2:"Numpad 2",numpad3:"Numpad 3",numpad4:"Numpad 4",numpad5:"Numpad 5",numpad6:"Numpad 6",numpad7:"Numpad 7",numpad8:"Numpad 8",numpad9:"Numpad 9",multiply:"Multiply",add:"Add",subtract:"Subtract",decimalPoint:"Decimal Point",divide:"Divide",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Semicolon",equalSign:"Equal Sign",comma:"Comma",dash:"Dash",period:"Period",forwardSlash:"Forward Slash",graveAccent:"Grave Accent",openBracket:"Open Bracket",backSlash:"Backslash",closeBracket:"Close Bracket",singleQuote:"Single Quote"});